import React from "react";

const HighScoreTable = ({ country }) => {
    return (
        <>
            <h2>High scores: {country.name}</h2>
            <table>
                <tbody>
                    <tr>
                        <th>Name</th>
                        <th>Score</th>
                    </tr>
                    {country.scores.map((score, index) => {
                        return (
                            <tr className key={index}>
                                <td>{score.n}</td>
                                <td>{score.s}</td>
                            </tr>
                        )
                    })}
                </tbody>
            </table>
        </>
    )
}

export default HighScoreTable;
